import Icons from "../assets/Icons";

const Dashboard = () => {
  return (
    <div className="nav-bar dp-f border-2px">
      <div className="keep-icon dp-f border-2px">
        <div className="list-3">
        <Icons name="List" size=""/>

        </div>
        <div className="name-page">hii</div>
      </div>

      <div className="search-div border-2px">hey</div>
      <div className="icons-end border-2px">work</div>
    </div>
  );
};
export default Dashboard;
